-- Database *Bank*

-- 1. Общее описание БД и решаемых ею задач:
-- База данных позволяет мониторить остатки по счетам клиентов, состояние ссудной задолженности, размер сформированного резерва, вид и стоимость обеспечения

-- 2. Создание БД bank (с первичными ключами, индексами, внешними ключами)

DROP DATABASE IF EXISTS bank;
CREATE DATABASE bank;
USE bank;

-- 2.1. Создание таблицы clients - все клиенты банка
DROP TABLE IF EXISTS clients;
CREATE TABLE clients(
	id SERIAL PRIMARY KEY,
	status VARCHAR (20) COMMENT 'физлицо/юрлицо',
	citizenship VARCHAR (50) COMMENT 'гражданство',
	tax_number VARCHAR (20) UNIQUE COMMENT 'номер налогоплательщика',
	address VARCHAR (255),
	phone VARCHAR (35),
	INDEX(tax_number) 
);

-- 2.2. Создание таблицы individuals: клиенты-физические лица
DROP TABLE IF EXISTS individuals;
CREATE TABLE individuals(
	id SERIAL PRIMARY KEY,
	client_id BIGINT UNSIGNED NOT NULL,
	gender CHAR(1),
    name VARCHAR(100),
    surname VARCHAR(100),
    birthday DATE,
    passport VARCHAR(20) UNIQUE COMMENT 'серия, номер паспорта',
    birthplace VARCHAR(100) COMMENT 'место рождения по паспорту',
	created_at DATETIME DEFAULT NOW(),
    INDEX(passport),
    FOREIGN KEY (client_id) REFERENCES clients(id)
);

-- 2.3. Создание таблицы organizations: клиенты-организации (всех форм собственности, в т.ч. госучреждения, фонды, некомм.организации и т.п.)
DROP TABLE IF EXISTS organizations;
CREATE TABLE organizations(
	id SERIAL PRIMARY KEY,
	client_id BIGINT UNSIGNED NOT NULL,
	legal_form VARCHAR(100) COMMENT 'организационно-правовая форма',
    name VARCHAR(100) COMMENT 'наименование организации', 
    creation_date DATE,
    reg_number VARCHAR(20) UNIQUE COMMENT 'регистрационный номер организации',
    ceo VARCHAR(100)COMMENT 'руководитель организации',
	created_at DATETIME DEFAULT NOW(),
    INDEX(reg_number),
    FOREIGN KEY (client_id) REFERENCES clients(id)
);

-- 2.4. Создание таблицы accounts: остатки на счетах клиентов (пассивные счета: расчетные, валютные, транзитные, депозитные и т.д.)
DROP TABLE IF EXISTS accounts;
CREATE TABLE accounts(
	id SERIAL PRIMARY KEY,
	client_id BIGINT UNSIGNED NOT NULL,
	account_num VARCHAR(100)COMMENT 'номер счета',
	account_balance DECIMAL (15,2) COMMENT 'баланс счета',
	account_type VARCHAR(100) COMMENT 'тип счета: расчетный, валютный, депозитный',
    created_at DATETIME DEFAULT NOW(),
    INDEX(account_num),
    FOREIGN KEY (client_id) REFERENCES clients(id)
);


-- 2.5. Создание таблицы credit_form: Форма финансирования (кредиты, кредитные линии, овердрафты, гарантии, аккредитивы и т.д.)
DROP TABLE IF EXISTS credit_form;
CREATE TABLE credit_form(
	id SERIAL PRIMARY KEY,
	form VARCHAR(100) COMMENT 'форма финансирования'
);


-- 2.6. Создание таблицы products: банковские кредитные продукты
DROP TABLE IF EXISTS products;
CREATE TABLE products(
	id SERIAL PRIMARY KEY,
	credit_form_id BIGINT UNSIGNED NOT NULL,
	name VARCHAR(100) COMMENT 'наименование продукта',
	FOREIGN KEY (credit_form_id) REFERENCES credit_form(id)
);

-- 2.7. Создание таблицы credits: остатки на кредитных счетах клиентов (активные счета: кредит, кредитная линия, овердрафт, раскрывшийся аккредитив и т.д.)
DROP TABLE IF EXISTS credits;
CREATE TABLE credits(
	id SERIAL PRIMARY KEY,
	borrower_id BIGINT UNSIGNED NOT NULL COMMENT 'id заемщика',
	agreement_num VARCHAR(100)COMMENT 'номер кредитного договора',
	agreement_date DATE COMMENT 'дата кредитного договора',
	credit_date DATE COMMENT 'дата выдачи кредита',
	repayment_date DATE COMMENT 'дата погашения кредита',
	product_id BIGINT UNSIGNED NOT NULL COMMENT 'продукт',
	interest_rate NUMERIC (5,2) COMMENT 'процентная ставка',
	currency VARCHAR(100)COMMENT 'валюта',
	credit_sum DECIMAL (15,2) COMMENT 'сумма финансирования',
	credit_balance DECIMAL (15,2) COMMENT 'остаток срочной задолженности',
	credit_limit DECIMAL (15,2) COMMENT 'свободный лимит',
	interest_balance DECIMAL (15,2) COMMENT 'остаток срочных начисленных, но не уплаченных процентов',
	credit_balance_overdue DECIMAL (15,2) COMMENT 'просроченная задолженность',
	interest_balance_overdue DECIMAL (15,2) COMMENT 'просроченные проценты',
	overdue BIGINT UNSIGNED COMMENT 'количество дней просрочки',
	reserve_rate NUMERIC (5,2) COMMENT 'ставка резервирования на возможные потери',
	updated_at DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
    INDEX(agreement_num),
    INDEX(product_id),
  	FOREIGN KEY (product_id) REFERENCES products(id),
    FOREIGN KEY (borrower_id) REFERENCES clients(id)
);

-- 2.8. Создание таблицы pledge_type: типы залогов (недвижимость, транспортное средство, спецтехника, оборудование, товары в обороте, права требования, депозит, гарантии, ценные бумаги и тп.) 
DROP TABLE IF EXISTS pledge_type;
CREATE TABLE pledge_type(
	id SERIAL PRIMARY KEY,
	name VARCHAR(100) COMMENT 'тип залога'	
);

-- 2.9. Создание таблицы pledges: обеспечение по кредитам (залогодатель, залоговое имущество, обеспечиваемое обязательство)
DROP TABLE IF EXISTS pledges;
CREATE TABLE pledges(
	id SERIAL PRIMARY KEY,
	from_client_id BIGINT UNSIGNED NOT NULL COMMENT 'залогодатель',
    to_credit_id BIGINT UNSIGNED NOT NULL COMMENT 'обеспечиваемое обязательство',
    pledge_type_id BIGINT UNSIGNED NOT NULL COMMENT 'тип залога',
    description TEXT COMMENT 'описание залога',
    pledge_reg_num VARCHAR(100)COMMENT 'идентификационный номер предмета залога: vin, рег.запись',
    pledge_value DECIMAL (15,2) COMMENT 'стоимость залога',
    category BIGINT UNSIGNED NOT NULL COMMENT 'категория качества обеспечения: 0, 1, 2',
    created_at DATETIME default NOW(),
    updated_at DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
    INDEX(from_client_id),
  	INDEX(to_credit_id),
  	INDEX(pledge_reg_num),
  	FOREIGN KEY (from_client_id) REFERENCES clients(id),
  	FOREIGN KEY (to_credit_id) REFERENCES credits(id),
  	FOREIGN KEY (pledge_type_id) REFERENCES pledge_type(id)
);

-- 2.10. Создание таблицы scans: скан-копии документов по клиенту (паспорт, свидетельство ИНН, ОГРН, приказ о назначении руководителя, карточка с образцом подписи)
DROP TABLE IF EXISTS scans;
CREATE TABLE scans(
	id SERIAL PRIMARY KEY,
	file VARCHAR(255),
	client_id BIGINT UNSIGNED NOT NULL,
	description text,
	created_at DATETIME DEFAULT NOW(),
	updated_at DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
	FOREIGN KEY (client_id) REFERENCES clients(id)
);




